// Dashboard.js

import React from 'react';
import ProductService from '../services/productservices';

function Dashboard() {
  return (
    <div>
      <h2>Dashboard</h2>
      
      <div className="section">
        <h3>Product Service</h3>
        <ProductService />
      </div>
    </div>
  );
}

export default Dashboard;
